import React, {useState} from 'react';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {Dialogs} from "./components/profileContentComponents/Dialogs/Dialogs";
import {ProfileContent} from "./components/profileContentComponents/Profile/ProfileContent";
import {NavBar} from "./components/Navbar/NavBar";
import {Header} from "./components/Header/Header";
import state, {RootStateType} from "./redux/state";

export interface AppProps {
    state: RootStateType;
    removePost: (id: string) => void;
}


function App({state}: AppProps) {
    const [posts, setPosts] = useState(state.profilePage.posts);
    const removePost = (id: string) => setPosts(posts.filter(post => post.id !== id))
    return (
            <div className="app-wrapper">
                <Header/>
                <NavBar/>
                <div className="app-wrapper-content">
                    <Routes>
                        <Route path={'PROFILE'}
                               element={<ProfileContent posts={state.profilePage && state.profilePage.posts} removePost={removePost}/>}/>
                        <Route path={'DIALOGS/:DIALOG?'} element={<Dialogs messagesData={state.dialogsPage.messagesData} usersData={state.dialogsPage.usersData} />}/>


                        {/*<Route path={'NEWS'} element={<News/>}/>*/}
                        {/*<Route path={'MUSIC'} element={<Music/>}/>*/}
                        {/*<Route path={'SETTINGS'} element={<Settings/>}/>*/}
                    </Routes>
                </div>
            </div>
    );

}


export default App;
